import React from 'react';
import './App.css';
import Header from './components/Header';
import { Button } from 'reactstrap';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Header></Header>
        <p>Hello world</p>
        <Button onClick={function(){alert("HI");}}>HI</Button>
      </header>
    </div>
  );
}

export default App;
